package com.gb.flutter_gb_pos_print;

import androidx.annotation.NonNull;

import io.flutter.embedding.engine.plugins.FlutterPlugin;
import io.flutter.plugin.common.MethodCall;
import io.flutter.plugin.common.MethodChannel;
import io.flutter.plugin.common.MethodChannel.MethodCallHandler;
import io.flutter.plugin.common.MethodChannel.Result;

import android.graphics.Bitmap;
import android.graphics.BitmapFactory;
import android.util.Base64;

/** FlutterGbPosPrintPlugin */
public class FlutterGbPosPrintPlugin implements FlutterPlugin, MethodCallHandler {
  /// The MethodChannel that will the communication between Flutter and native Android
  ///
  /// This local reference serves to register the plugin with the Flutter Engine and unregister it
  /// when the Flutter Engine is detached from the Activity
  private MethodChannel channel;

  @Override
  public void onAttachedToEngine(@NonNull FlutterPluginBinding flutterPluginBinding) {
    channel = new MethodChannel(flutterPluginBinding.getBinaryMessenger(), "flutter_gb_pos_print");
    channel.setMethodCallHandler(this);
  }

  @Override
  public void onMethodCall(@NonNull MethodCall call, @NonNull Result result) {
    PrintManagerCore corec = new PrintManagerCore();

    if (call.method.equals("startPrint")) {
      String content = call.argument("content");
      corec.doPrint(0, content);
    } else if (call.method.equals("spacePrint")) {
      Integer line = call.argument("line");
      corec.doPrint(2, line);
    } else  if (call.method.equals("qrArea")) {
      String content = call.argument("content");
      corec.doPrint(3, content);
    } else  if (call.method.equals("dataMatrixArea")) {
      String content = call.argument("content");
      corec.doPrint(4, content);
    } else if (call.method.equals("endLogo")) {
      BitmapFactory.Options opts = new BitmapFactory.Options();
      opts.inPreferredConfig = Bitmap.Config.ARGB_8888;
      byte[] decodedString = Base64.decode(this.gbBase64Logo, Base64.DEFAULT);
      Bitmap bitmap = BitmapFactory.decodeByteArray(decodedString, 0, decodedString.length, opts);
      corec.doPrint(1, bitmap);
    } else if (call.method.equals("fullContent")) {
      String content = call.argument("content");
      boolean footerLogo = call.argument("footerLogo");
      String footerCode = call.argument("footerCode");
      String qrData = call.argument("qrData");
      Integer qrWidth = (Integer)call.argument("qrWidth");
      Integer qrHeight = (Integer)call.argument("qrHeight"); 
      Integer qrAlignment = (Integer)call.argument("qrAlignment");

      Bitmap footerBitmap = null;
      if(footerLogo) // footer image logo
      {
        String footerBase64Logo = "";
        if(footerCode.equals("GBB")) {
          footerBase64Logo = this.gbBase64Logo;
        } else if (footerCode.equals("EYP")) {
          footerBase64Logo = this.eypBase64Logo;
        } else { 
          footerBase64Logo = this.gbBase64Logo; 
        } 

        BitmapFactory.Options opts = new BitmapFactory.Options();
        opts.inPreferredConfig = Bitmap.Config.ARGB_8888;
        byte[] decodedString = Base64.decode(footerBase64Logo, Base64.DEFAULT);
        footerBitmap = BitmapFactory.decodeByteArray(decodedString, 0, decodedString.length, opts);
      }

      corec.doPrintFull(content, footerBitmap, qrData, qrWidth, qrHeight, qrAlignment);
    } else {
      result.notImplemented();
    }
  }

  String gbBase64Logo = "";

  String eypBase64Logo = "";

  @Override
  public void onDetachedFromEngine(@NonNull FlutterPluginBinding binding) {
    channel.setMethodCallHandler(null);
  }
}
